import React from 'react';
import Link from 'react-router';

class Register extends React.Component {

    handleSubmit = () => {

    }

    handleChange = () => {

    }

    render() {
        return (
            <div className="col-md-6 col-md-offset-3">
                <h2>Register</h2>
                <form name="form" onSubmit={this.handleSubmit}>
                    <div className='form-group'>
                        <label htmlFor="firstName">First Name</label>
                        <input type="text" className="form-control" name="firstName" value='' onChange={this.handleChange} />
                        {/* {submitted && !user.firstName &&
                            <div className="help-block">First Name is required</div>
                        } */}
                    </div>
                    <div className='form-group'>
                        <label htmlFor="lastName">Last Name</label>
                        <input type="text" className="form-control" name="lastName" value='' onChange={this.handleChange} />
                        {/* {submitted && !user.lastName &&
                            <div className="help-block">Last Name is required</div>
                        } */}
                    </div>
                    <div className='form-group'>
                        <label htmlFor="username">Username</label>
                        <input type="text" className="form-control" name="username" value='' onChange={this.handleChange} />
                        {/* {submitted && !user.username &&
                            <div className="help-block">Username is required</div>
                        } */}
                    </div>
                    <div className='form-group'>
                        <label htmlFor="password">Password</label>
                        <input type="password" className="form-control" name="password" value='' onChange={this.handleChange} />
                        {/* {submitted && !user.password &&
                            <div className="help-block">Password is required</div>
                        } */}
                    </div>
                    <div className='form-group'>
                        <label htmlFor="role">Role</label>
                        <select name="role" className="form-control" value='' onChange={this.handleChange}  >
                            <option value='User'>User</option>
                            <option value='Auditor'>Auditor</option>
                        </select>
                        {/* {submitted && !user.role &&
                            <div className="help-block">Role is required</div>
                        } */}
                    </div>
                    <div className="form-group">
                        <button className="btn btn-primary">Register</button>
                        {/* {registering &&
                            <img src="data:image/gif;base64," />
                        } */}
                        <Link to="/login" className="btn btn-link">Cancel</Link>
                    </div>
                </form>
            </div>
        )
    }
}

export default Register;
